import React from 'react'
import Head from 'next/head'

const Layout = ({ title, children }) => {
    return (
        <>
            <Head>
                <title> {title} </title>
            </Head>

            <div className="px-2 sm:px-16">
                {children}
            </div>

        </>
    )
}

export default Layout
